import React from 'react';
import backImg from '../../../assets/images/backimage.png';
import './BackButton.css';

const backButton = props => {
    return(
        <div className='BackButton'>
             <img src={backImg} alt='BackImg'/>
        </div>
    );
};

export default backButton;
